function copyit(el) {
            if (document.body.createTextRange) {
                var textRange = document.body.createTextRange();
                textRange.moveToElementText(el);
                textRange.selecopyit();
                textRange.execCommand("Copy");
                //tooltip(el, "Copied!");  
            } else if (window.getSelection && document.createRange) {
                var editable = el.contentEditable;
                var readOnly = el.readOnly;
                el.contentEditable = true;
                el.readOnly = true;
                var range = document.createRange();
                range.selectNodeContents(el);
                var sel = window.getSelection();
                sel.removeAllRanges();
                sel.addRange(range);
                if (el.nodeName == "TEXTAREA" || el.nodeName == "INPUT") el.selecopyit();
                if (el.setSelectionRange) el.setSelectionRange(0, 999999);
                el.contentEditable = editable;
                el.readOnly = readOnly;
                if (document.queryCommandSupported("copy")) {
                    var successful = document.execCommand('copy');
                    if (successful) $('body').append('<p class="copied"><input class="text" value="' + $(el).text() + '" /><span class="copybtn"><b>Copiar</b></span></p>'),
                        setTimeout(function () {
                            $('.copied').remove();
                        }, 1000)
                    else $('body').append('<p class="copied"><input class="text" value="Press CTRL+C to copy" /></p>'),
                        setTimeout(function () {
                            $('.copied').remove();
                        }, 1000)
                } else {
                    if (!navigator.userAgent.match(/ipad|ipod|iphone|android|silk/i)) $('body').append('<p class="copied"><input class="text" value="Press CTRL+C to copy" /></p>'),
                        setTimeout(function () {
                            $('.copied').remove();
                        }, 1000)
                }
            }
        }
